INSERT INTO `shared_items` VALUES (1,1,2000,2003,0,'2012-07-30 20:35:35',1,'Hello world',NULL),(2,1,2002,2009,0,'2012-07-31 21:14:15',1,'Yay! Officially the first alum to sign up .. or so it seems :)',NULL),(3,1,2002,2022,12,'2012-08-03 09:10:07',0,'Helasdfd',NULL),(4,2,2002,2029,12,'2012-08-06 17:09:01',0,'Hallo.\n',NULL),(5,3,2002,3,12,'2012-08-08 12:11:08',0,'Hello MBAs!',1),(6,1,2003,3,10,'2012-08-24 06:42:25',0,'Hello Prof. Roberts',NULL),(7,2,2003,2053,10,'2012-08-24 06:42:47',0,'i love e&i',NULL),(8,1,2003,3,0,'2012-08-24 06:43:45',0,'Community level',NULL),(9,3,2003,2068,10,'2012-08-25 09:07:00',1,'My team launched the first certified sustainable triathlon in SoCal.  Our dual primary goals were 1) raise money to subsidize students racing, and 2) promote and achieve sustainability in sport.\nExamples of sustainability include:\n-sourced all food from local sources (except some ingredients for the wheaten foods)\n-reduced paper use from standard race amount to <1 sheet per athlete\n-significantly reduced waste by eliminating disposable bottles\n-solar power use\n-green athlete award encouraging athletes to add sustainability aspects to the commute\n and race environment\n\nLots more too. Ask any questions!',NULL),(10,2,2002,2085,0,'2012-08-25 19:55:26',1,'This is intense and quite cool. Well done! Some feedback: I couldn\'t seem to skip any questions I didn\'t want to answer. It seemed to stall on me when I did that and just give me the same question again. Any reason for that? Also, there\'s no \"other\" option for previous career. None of those are accurate for me (and I am thinking many others too probably). ',NULL),(11,1,2003,2090,14,'2012-08-26 07:44:49',0,'Hi, anyone interested in working on tech/energy startups in USA with manaufacturing base in China?',NULL),(12,3,2002,2097,0,'2012-08-26 11:49:35',0,'This seems to have some potential. Looking forward to see it grow!',NULL),(13,2,2003,2134,0,'2012-08-26 13:14:48',0,'Nice platform',NULL),(14,4,2002,2068,0,'2012-08-26 20:52:09',0,'Tired of introducing yourself to Sloanies? Meet the rest of the school.\n\nt=0 entrepreneurship festival is coming up - get your hands dirty. \n\nRegister today. http://t0.mit.edu/details/details-details_registration/\n\nWhat is t=0?\nt=0 is a weeklong event celebrating innovation and entrepreneurship at MIT. Come be inspired by and meet the hottest innovators and entrepreneurs at MIT with activities spread throughout Sept. 8th â?? 16th. Get excited to start something now!',NULL),(15,1,2003,2068,7,'2012-08-26 20:55:44',0,'In case you are not active in the google groups...     t=0 is approaching and needs some volunteers.       If you are interested in helping out with Demo Day or the Hackathon, please add your name and information to the Google Document below.\n\nhttps://docs.google.com/spreadsheet/ccc?key=0AvViiJWMEpfqdDAycmEzZFFSS1JiM3EwYlItSFdXdnc',NULL);
